import React from 'react'
import { ArrowLeft, ArrowRight } from '@mui/icons-material'
import { styled } from 'styled-components'

const Container=styled.div`
    width:100%;
    height:100vh;
    display:flex;
    background-color:coral;
    position: relative;
    overflow: hidden;
`;
const Arrow=styled.div`
    width: 50px;
    height:50px;
    background-color: #fff7f7;
    border-radius: 50%;
    display: flex;
    align-items: center;
    justify-content:center;
    position : absolute;
    top:0;
    bottom:0;
    left: ${props => props.direction === "left" && "10px"};
    right: ${props => props.direction === "right" && "10px"};
    margin:auto;
    cursor: pointer;
    opacity:0.5;

`;
const Wrapper=styled.div`
height:100%;
display:flex;
transform:translateX(-200vw);
`;

const Slide=styled.div`
width:100vw;
height:100vh;
display:flex;
align-items:center;
background-color: ${props=>props.bg};
`;

const ImageContainer=styled.div`
height:100%;
flex:1;
`;
const Image=styled.img`
height:80%;
/* border-radius: 100%; */
`;
const InfoContainer=styled.div`
padding:50px;
flex:1;
`;
const Title= styled.h1`
font-size:70px;
`;
const Description= styled.p`
margin: 50px 0px;
font-size:20px;
font-weight:500;
letter-spacing:3px;
`;
const Button= styled.button`
padding:10px;
font-size:2-px;
background-color: transparent;
cursor:pointer;
`;

const Features = () => {
    const handleClick =(direction)=>{

    };

  return (
    <Container>
    <Arrow direction="left" onClick={()=>handleClick("left")}>
        <ArrowLeft/>
    </Arrow >
    <Wrapper>
        <Slide bg="peachpuff">
        <ImageContainer>
            <Image src="https://images.unsplash.com/photo-1581182800629-7d90925ad072?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&w=1170&q=80"></Image>
        </ImageContainer>
        <InfoContainer>
            <Title>SKIN CARE</Title>
            <Description>
            Our handmade skincare collection is a celebration of simplicity and authenticity. We believe that nature holds the key to unlocking the true potential of your skin, which is why we meticulously select the finest botanicals, essential oils, and other plant-based ingredients to formulate our products.
            </Description>
            <Button>SHOW NOW</Button>
        </InfoContainer>
        </Slide>
        <Slide bg="lightsalmon">
        <ImageContainer>
            <Image src="https://img.freepik.com/free-photo/female-lips-closeup_144627-30211.jpg?w=1380&t=st=1689872145~exp=1689872745~hmac=2d989a8ab8bbfb1cfe17fb914c441f7ec56cdf92de32de6b2c308239431f9716"></Image>
        </ImageContainer>
        <InfoContainer>
            <Title>LIP CARE</Title>
            <Description>
            Say goodbye to dry, chapped lips with our exquisite homemade lip care products. Treat your lips to a burst of natural goodness, enriched with moisturizing butters, soothing oils, and rejuvenating vitamins. Our homemade lip care collection is thoughtfully designed to provide intense hydration, leaving your lips soft, supple, and irresistibly kissable. Embrace the gentle touch of nature as our lip care products protect your delicate pout from harsh environmental elements, adding a touch of allure to your smile. Elevate your lip care routine with the simplicity and purity of homemade goodness, and let your lips speak volumes.
            </Description>
            <Button>SHOW NOW</Button>
        </InfoContainer>
        </Slide>
        <Slide bg="powderblue">
        <ImageContainer>
            <Image src="https://img.freepik.com/free-photo/beauty-portrait-mystery-smiling-ginger-woman-with-long-hair-posing-sideways-looking_171337-920.jpg?w=1380&t=st=1689872238~exp=1689872838~hmac=72f0490ded1dfb0ba676e6bded5c2b3f5dd69906bc05499e4588679f860c9a40"></Image>
        </ImageContainer>
        <InfoContainer>
            <Title>HAIR CARE</Title>
            <Description>
            Indulge your hair in the goodness of homemade haircare products, specially crafted to restore and enhance your locks naturally. Our homemade haircare range is a labor of love, carefully blending botanical extracts, essential oils, and nourishing ingredients to breathe life back into your hair. Embrace the power of nature as our products promote healthy hair growth, strengthen your strands, and leave you with luscious, salon-worthy tresses. Experience the difference of homemade haircare, free from harmful chemicals, and revel in the beauty of revitalized, vibrant hair.
            </Description>
            <Button>SHOW NOW</Button>
        </InfoContainer>
        </Slide>
    </Wrapper>
    <Arrow direction="right" onClick={()=>handleClick("right")}>
        <ArrowRight/>
    </Arrow>
    
    </Container>
  )
}

export default Features
